INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (7, 106001, 7001, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (7, 105901, 7002, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (7, 105801, 7003, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (10, 105801, 10001, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (10, 106001, 10002, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (10, 105901, 10003, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (10, 106401, 10004, 2104010, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (12, 105801, 12001, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -416.5, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (13, 106001, 13001, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (13, 105901, 13002, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (13, 106401, 13003, 2104010, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (13, 105801, 13004, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (14, 105901, 14001, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (14, 106401, 14002, 2104010, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (14, 105801, 14003, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (14, 106001, 14004, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (15, 105901, 15001, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -470.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (16, 106401, 16001, 2104010, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (16, 105801, 16002, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (16, 106001, 16003, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (16, 105901, 16004, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (17, 105901, 17002, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (25, 106001, 17004, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (25, 105901, 17005, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (25, 106401, 17006, 2104010, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (25, 105801, 17007, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (18, 190801, 18001, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (18, 190801, 18002, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -363.0, 2, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (19, 190801, 19001, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -470.0, 3, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (19, 190801, 19002, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -470.0, 4, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (20, 190801, 20001, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -470.0, 5, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (20, 190801, 20002, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -470.0, 6, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (21, 106001, 21001, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (21, 105901, 21002, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (21, 106401, 21003, 2104010, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (21, 105801, 21004, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (22, 190801, 22001, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -430.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (22, 190801, 22002, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -430.0, 2, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (23, 190801, 23001, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -430.0, 3, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (23, 190801, 23002, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -430.0, 4, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109001, 24001, 0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2030/12/17 14:59:59", 1, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", -385.0, 1, 4.08, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109001, 24002, 0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2030/12/17 14:59:59", 1, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", -385.0, 2, 5.0, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109001, 24003, 0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2030/12/17 14:59:59", 1, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", -385.0, 3, 10.11, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109001, 24004, 0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2030/12/17 14:59:59", 1, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", -385.0, 4, 4.0, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109001, 24005, 0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2030/12/17 14:59:59", 1, 8.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", -385.0, 5, 6.0, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109002, 24006, 0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2030/12/17 14:59:59", 1, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0.0, 6, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109002, 24007, 0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2030/12/17 14:59:59", 1, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0.0, 7, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109002, 24008, 0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2030/12/17 14:59:59", 1, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0.0, 8, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109002, 24009, 0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2030/12/17 14:59:59", 1, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0.0, 9, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109002, 24010, 0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2030/12/17 14:59:59", 1, 0.0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0.0, 10, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109101, 24011, 0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2030/12/17 14:59:59", 1, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", -385.0, 1, 2.12, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109101, 24012, 0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2030/12/17 14:59:59", 5, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", -385.0, 2, 4.19, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109101, 24013, 0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2030/12/17 14:59:59", 2, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", -385.0, 3, 2.3, 4, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109102, 24014, 0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2030/12/17 14:59:59", 1, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0.0, 4, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109101, 24015, 0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2030/12/17 14:59:59", 5, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", -385.0, 5, 5.23, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109102, 24016, 0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2030/12/17 14:59:59", 1, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0.0, 6, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109101, 24017, 0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2030/12/17 14:59:59", 1, 8.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", -385.0, 7, 5.01, 2, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109102, 24018, 0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2030/12/17 14:59:59", 1, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0.0, 8, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109102, 24019, 0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2030/12/17 14:59:59", 1, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0.0, 9, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (24, 109102, 24020, 0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2030/12/17 14:59:59", 1, 0.0, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0.0, 10, 0.0, 1, 10011);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (26, 106401, 26001, 2104010, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (26, 105801, 26002, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (26, 106001, 26003, 0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (26, 105901, 26004, 0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (27, 106401, 27001, 2104010, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", "2030/12/17 14:59:59", 2, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (27, 105801, 27002, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (27, 106001, 27003, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
