INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (38, 105801, 38001, 0, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -458.0, 1, 5.3, 2, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (38, 105801, 38002, 0, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -458.0, 2, 6.5, 2, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (39, 105801, 39005, 0, "", "2020/04/08 23:59:59", 3, 9999.0, "ペコリーヌ", "2020/04/01", 9999.0, 0, 0.0, 3, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (40, 190801, 40001, 0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", "2030/12/17 14:59:59", 1, 0.0, "カリン", "2015/12/17 15:00:00", -430.0, 2, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (41, 106401, 41001, 2104010, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", "2030/12/17 14:59:59", 1, 0.0, "シェフィ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (41, 105801, 41002, 0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (41, 106001, 41003, 0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (41, 105901, 41004, 0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (42, 105901, 42001, 0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -416.5, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (42, 106401, 42002, 2104010, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", "2030/12/17 14:59:59", 1, 0.0, "シェフィ", "2015/12/17 15:00:00", -416.5, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (42, 105801, 42003, 0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -416.5, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (42, 106001, 42004, 0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -416.5, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (43, 105801, 43001, 0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "2030/12/17 14:59:59", 1, 0.0, "ペコリーヌ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (43, 105901, 43002, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "2030/12/17 14:59:59", 1, 0.0, "コッコロ", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (43, 106001, 43003, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "2030/12/17 14:59:59", 1, 0.0, "キャル", "2015/12/17 15:00:00", -363.0, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (44, 123001, 43004, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "2030/12/17 14:59:59", 1, 0.0, "アメス", "2015/12/17 15:00:00", -416.5, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (44, 123001, 43005, 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "2030/12/17 14:59:59", 1, 0.0, "アメス", "2015/12/17 15:00:00", -416.5, 2, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (45, 123001, 43006, 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "2030/12/17 14:59:59", 1, 0.0, "アメス", "2015/12/17 15:00:00", -416.5, 3, 5.79, 2, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (46, 123001, 46001, 0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "2030/12/17 14:59:59", 1, 0.0, "アメス", "2015/12/17 15:00:00", -371.5, 1, 0.0, 1, 0);
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (47, 104901, 47001, 0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", "2030/12/17 14:59:59", 2, 0.0, "シズル", "2015/12/17 15:00:00", -416.5, 1, 0.0, 2, 0);
